  `asin` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '亚马逊ASIN',
  `fnsku` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT 'FNSKU',
